import React from 'react';
import '../App.css';

function CalculateHome(){
    return(
        <nav className="calculate-home">
            <h1 className="title">EXPOSURE CALCULATION</h1>
            <p className="desc">
                This is the landing page for the different types of calculations.
            </p>
        </nav>
    )
}

export default CalculateHome;
